import React, { useEffect, useState } from "react";
import axios from "axios"

const Home = () => {
  const [tode, setTode] = useState([]);
  const [error, setError] = useState(null);
  const [loading, SetLoading] = useState(false);

  useEffect(() => {
    const featchdata = async () => {
      try {
        SetLoading(true);
        const response = await axios.post("http://localhost:4000/api/todo/create");
      } catch (error) {
        setError(error);
      } finally {
        SetLoading(false);
      }
    };
  });

  return <div>Home</div>;
};

export default Home;
